import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="flex justify-between w-screen h-screen p-5 bg-gradient-to-r from-teal-200 via-indigo-100 to-lime-100 ">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <div className='justify-center rounded-l-lg w-75 d-flex align-items-centers bg-light'>

        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        </div>
        <div className='bg-white rounded-r-lg w-25'>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        </div>
    </div>
  );
}

export default App;
